import{_ as a,c as e,o as r,a2 as t}from"./chunks/framework.Ja7AKUN6.js";const f=JSON.parse('{"title":"开往 - 友链接力","description":"","frontmatter":{},"headers":[],"relativePath":"README.md","filePath":"README.md"}'),l={name:"README.md"},i=t('<h1 id="开往-友链接力" tabindex="-1">开往 - 友链接力 <a class="header-anchor" href="#开往-友链接力" aria-label="Permalink to &quot;开往 - 友链接力&quot;">​</a></h1><p>Language: <strong>简体中文</strong> | <a href="./en_US/README.html">English</a></p><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>「开往 Travellings」是一个友链接力项目，旨在通过网络跳转的方式将流量引入那些鲜为人知的独立站点，从而推动网络的开放性和多元性。</p><p>该项目于 2020 年 3 月 12 日诞生，灵感来源于<strong>开</strong>放的<strong>网</strong>络。其 Logo 由代表“世界”的星环和代表“穿梭”的列车组成，正如我们常常在列车上听到的“由 xx 开往 xx 的列车……”一样，寓意着在网络世界中穿梭。</p><p>每当用户访问加入「开往 Travellings」的网页时，点击该网页上的“开往”按钮将随机跳转到另一个加入该项目的网页。无论是再次点击“开往”还是后退网页，都会继续随机跳转到其他参与者的网页。</p><p>截至目前，「开往 Travellings」已经吸引了 1k+ 人的关注 <a href="https://github.com/travellings-link/travellings/stargazers" target="_blank" rel="noreferrer"><img src="https://img.shields.io/github/stars/travellings-link/travellings?style=social" alt="GitHub stars"></a>，并有 1k+ 成员加入了该项目。随着越来越多的网页选择加入「开往 Travellings」的行列，我们的友链网络也在不断扩大，这将进一步推动分享流量的增长，为本项目注入更多活力。</p><ul><li>点此<a href="https://list.travellings.cn" target="_blank" rel="noreferrer">查看成员列表</a></li><li>点此<a href="https://www.travellings.cn" target="_blank" rel="noreferrer">访问开往官网</a></li></ul><p><img src="https://github.com/travellings-link/travellings/assets/66854530/572a3e88-828c-48f6-b7db-fcdb361b3295" alt="image"></p><h2 id="项目说明" tabindex="-1">项目说明 <a class="header-anchor" href="#项目说明" aria-label="Permalink to &quot;项目说明&quot;">​</a></h2><p>开往主站现基于 VitePress 构建。</p><ul><li><code>public</code> 文件夹存放静态文件，会被放置到根目录下。开往最重要的跳转页也在其中。如果你想制作新的跳转页，请查看 <a href="./docs/join.html#参与项目">参与项目</a></li><li><code>announcements</code> 文件夹中放置的是公告 (Markdown 格式)</li><li><code>blog</code> 文件夹中放置的是博客 (Markdown 格式)</li><li><code>docs</code> 文件夹放置的是文档 (Markdown 格式)</li></ul><p>更多请参见 <a href="https://vitepress.dev/" target="_blank" rel="noreferrer">VitePress 文档</a></p><h2 id="也许你在找这些" tabindex="-1">也许你在找这些 <a class="header-anchor" href="#也许你在找这些" aria-label="Permalink to &quot;也许你在找这些&quot;">​</a></h2><ul><li>点此<a href="./docs/">查看完整的开往简介</a></li><li>点此<a href="./docs/join.html">查看加入开往要求</a></li><li>点此<a href="./docs/qa.html">查看常见疑难解答</a></li><li>点此<a href="./docs/toyou.html">查看加入开往维护组要求</a></li><li>点此<a href="https://afdian.com/a/travellings" target="_blank" rel="noreferrer">赞助</a>，所获赞助费用将用于服务器、DNS加速、域名续费。如有结余会在特定时间节点采用制作周边的方式回馈社区。</li></ul>',15),s=[i];function o(n,h,c,d,g,p){return r(),e("div",null,s)}const u=a(l,[["render",o]]);export{f as __pageData,u as default};
